function initAutocomplete() {
    var centerLocalizacao = {};
    
    centerLocalizacao.lat = -33.8688;
    centerLocalizacao.lng = 151.2195;
    
    if ((document.getElementById('cd_latitude') && document.getElementById('cd_longitude')) && (document.getElementById('cd_latitude').value.length > 0 && document.getElementById('cd_longitude').value.length > 0)) {
        centerLocalizacao.lat = parseFloat(document.getElementById('cd_latitude').value);
        centerLocalizacao.lng = parseFloat(document.getElementById('cd_longitude').value);
    }
    
    var e = new google.maps.Map(document.getElementById("map"), {
            center: centerLocalizacao,
            zoom: 12,
            mapTypeId: google.maps.MapTypeId.ROADMAP
        }),
        o = document.getElementById("pac-input"),
        n = new google.maps.places.SearchBox(o);

    var marker = new google.maps.Marker({
        position: centerLocalizacao,
        title:"Hello World!",
        zoom: 12,
    });
    
    marker.setMap(e);
    
    e.addListener("bounds_changed", function() {
        n.setBounds(e.getBounds())
    });
    
    var t = [];
    n.addListener("places_changed", function() {
        marker.setMap(null);
        var o = n.getPlaces();
        if (0 != o.length) {
            t.forEach(function(e) {
                e.setMap(null)
            }), t = [];
            
            var a = new google.maps.LatLngBounds;
            
            o.forEach(function(o) {
                var n = {
                    url: o.icon,
                    size: new google.maps.Size(71, 71),
                    origin: new google.maps.Point(0, 0),
                    anchor: new google.maps.Point(17, 34),
                    scaledSize: new google.maps.Size(25, 25)
                };
                
                document.getElementById('cd_latitude').value = o.geometry.location.lat();
                document.getElementById('cd_longitude').value = o.geometry.location.lng();
                
                t.push(new google.maps.Marker({
                    map: e,
                    icon: n,
                    title: o.name,
                    position: o.geometry.location
                })), o.geometry.viewport ? a.union(o.geometry.viewport) : a.extend(o.geometry.location)
                
            }), e.fitBounds(a)
        }
    })
}